import styled from "styled-components";

export const Container = styled.div`
  width: 100%;
  height: 70px;
  background: #20295f;
  border-bottom: 3px solid #ee6b25;

  display: flex;
`;

export const LeftSide = styled.div`
  width: 100%;
  height: 70px;
  display: flex;
  align-items: center


  img {
    width: 100px;
    height: 40px;
  }
`;

export const RightSide = styled.div`
  width: 100%;
  height: 70px;
`;
